import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  blockChaussure: {
    position: 'relative',
    display: 'flex',
    alignItems: 'center',
    width: '428px',
    height: '430px',
    backgroundColor: 'rgba(0,0,0,0.12)',
    padding: '0.5rem',
    margin: '0.5rem',
  },
  imgCroix: {
    position: 'absolute',
    top: '30px',
    right: '20px',
    width: '65px',
    height: '65px',
  },
  imgChaussure: {
    // paddingTop: '200px',
    // paddingRight: '30px',
    width: '400px',
    height: '280px',
  },
  blockBlanc: {
    width: '428px',
    backgroundColor: 'red',
    borderTopLeftRadius: '20px',
    borderTopRightRadius: '20px',
    padding: '20px',
    marginTop: '-25px',
  }
});
